- Good quality for the price'",0.855677},{"'Had it for only one month and one of the earphones is already dead. Sound quality is good nevertheless.'",0.0212295},{"'- Very easy to assemble - Not to noisy - Good quality for the price'",0.855677},{"'Produit très efficace pour son prix. Il faut simplement s'assurer d'utiliser le câble qui est fourni avec le chargeur portatif, car avec d'autres câbles le temps de charge peut être est plus long.'",0.3930445}}
